template <typename T> inline int Chkmin (T &a, T b) { return a > b ? a = b, 1 : 0; }

template <typename T> inline T read(){
    T sum = 0;
    int fl = 1,ch = getchar();
    for(; !isdigit(ch); ch = getchar()) if(ch == '-') fl = -1;
    for(; isdigit(ch); ch = getchar()) sum = (sum << 3) + (sum << 1) + ch - '0';
    return sum * fl;
}

int t,a,b,c,d,k;

inline void Solve (){
	while(t--){
		int ans1,ans2;
		a = read<int>();
		b = read<int>();
		c = read<int>();
		d = read<int>();
		k = read<int>();
		if(a % c){
			ans1 = a / c + 1;
		}else ans1 = a / c;
		if(b % d){
			ans2 = b / d + 1;
		}else ans2 = b / d;
		if(ans1 + ans2 > k){
			printf("-1\n");
		}else printf("%d %d\n",ans1,ans2);
	}
}

inline void Input (){
	t = read<int>();
}

int main(){
	Input();
	Solve();
	return 0;
}
