#include<bits/stdc++.h>
#include<iostream>
#include<cstdio>
#define ll long long
using namespace std;

ll a,b,c,d,k,x,y;

inline ll read(){
	ll x=0,tmp=1;
	char ch=getchar();
	while(!isdigit(ch)){
		if(ch=='-') tmp=-1;
		ch=getchar();
	}
	while(isdigit(ch)){
		x=(x<<3)+(x<<1)+(ch^48);
		ch=getchar();
	}
	return tmp*x;
}

inline void write(ll x){
	if(x<0){
		x=-x;
		putchar('-');
	}
	ll y=10,len=1;
	while(y<=x){
		y=(y<<3)+(y<<1);
		len++;
	}
	while(len--){
		y/=10;
		putchar(x/y+48);
		x%=y;
	}
}

int main(){
	for(ll T=read(); T; T--){
		a=read(); b=read(); c=read(); d=read(); k=read();
		x=a/c; y=b/d;
		if(a%c) x++;
		if(b%d) y++;
		//还没有用完，要多一支
		if(x+y>k) printf("-1\n");
		else printf("%I64d %I64d\n",x,y);
	}
	return 0;
}
